I am trying to code an Eclipse editor what would have an expandable section. The section would contain a table control with a lot of columns so it's quite wide. My intent is to have the table display scrollbar if the form is too small and I specifically don't want any scrollbars on the form itself.

I use GridLayout and GridData with hGrab=true, vGrab=true, hAligh=fill and vAlign=fill.

The resulting behavior is strange:
1. Once the editor is open it looks ok - scrollbar on the table, no scrollbars on the form. (see http://www.ys-ever.com/EBug/1.gif)
2. If i use the twistie to collapse the section I get a scrollbar on the form (http://www.ys-ever.com/EBug/2.gif), which i don't expect.
3. If I expand the section: the scrollbar stays on the whole form and the table has no scrollbar (http://www.ys-ever.com/EBug/3.gif). From this point on it is stuck like that.

This seems at the very least inconsistent.

