You should set the widthHint to some minimum value (say, 400) to prevent the table from reporting a huge width to the layout manager:

table.setLayoutData(new GridData(SWT.FILL, SWT.FILL, true,
true));

((GridData)table.getLayoutData()).widthHint = 400;

