CDT HEAD:
When pasting a comment line starting with // all spaces after the two slashes get lost. To reproduce enable Adjust indentation option in Preferences->C/C++->Editor->Typing, then copy and paste the following line:

// Some text

The patch fixes this bug (which is probably my bad) by leaving line comments starting at column 1 untouched, but the result is not quite consistent with the IndentAction (Ctrl+I) which still indents inside line comments.
The question is: Should we keep the original JDT functionality or should we rather drop this "feature" completely, as it tends to confuse.
Example:
if (cond) {
//  pasted with "indent inside line comment"
    code();
}
if (cond) {
    // pasted without "indent inside line comment"
    code();
}

I did the necessary changes to disable the "indent inside line comments"-feature, but did not completely remove it, instead made it an option (currently not user editable).
Ie. line comments starting at column 1 are now handled like all other line comments or code lines.

if (cond) {
// my line comment
    code();
}

will become

if (cond) {
    // my line comment
    code();
}

